import React from 'react';

const CV = () => (
  <section id="cv">
    <h2>Curriculum Vitae</h2>
    <p>Click the link below to download my CV:</p>
    <a href="/path-to-your-cv.pdf" download>Download CV</a>
    <h2>Cover Letter</h2>
    <p>Click the link below to download my cover letter:</p>
    <a href="/path-to-your-cover-letter.pdf" download>Download Cover Letter</a>
  </section>
);

export default CV;
